(1, 'Cube', 'Cube game', 2, SYSTEM_COMBINE_BLOB(0), '1'),
(2, 'Flower', 'flower', 15, SYSTEM_COMBINE_BLOB(1), '1'),
(3, 'Christmas tree', 'Standing at 7.5-feet, this hinged Christmas tree is an eye-catching addition to any room during the holidays Easy-to-fluff branches are covered in 1346 tips to create the natural appearance of a full-bodied, genuine Spruce tree Sturdy foldable steel base provides stability to keep your tree standing tall and prevents breakage Disassembles into 3 hinged sections to allow for easy assembling, dismantling, and storing Fits perfectly in our tree storage bags, search: B07KMGGH5R, B07KMGBYMG, or B076B', 50, SYSTEM_COMBINE_BLOB(2), '1'),
(4, 'Bottle Opener', STRINGDECODE('GREAT MATERIAL: Made of stainless steel, sturdy and durable PROPER SIZE\uff1a7\" long x 1.5\" wide\uff0cThe bottom of the handle has a round hole can be suspended, easy to store FUNCTION\u2002QUALITY: Slim, Compact, and Durable APPLICATION: Use the top of the hole to open the beer, soft drinks, soda water, coca cola and more,great for professional bartenders or home use 100% SATISFACTION GUARANTEE:If something breaks or if you not 100% satisfied with our bottle opener, simply let us know and you will be offered '), 5, SYSTEM_COMBINE_BLOB(3), '1'),
(5, 'Laptop', 'The flexible 360 Degree hinge and 12.5" full-HD touchscreen lets you use the C302 in tablet or laptop mode Intel Core Processor with 64GB storage and 4GB RAM for fast and efficient performance with a bright backlit illuminated keyboard Extremely lightweight at 2.65 pounds with the protection of a sleek aluminum metal body Starts up in seconds and lasts all day, thanks to a long battery life rated up to 10 hours NOTE: Check User Manual in Technical Specification before use', 1500, SYSTEM_COMBINE_BLOB(4), '1'),
(6, 'Car Seat For Child', 'Built to grow with your child, this Safety 1st car seat supports infants from five pounds to toddlers of 40 pounds as a rear-facing car seat, 22 to 65 pounds forward-facing toddler car seat, and 40 to 100 pounds as a belt-positioning booster An adjustable three-position recline makes it easy to get a good fit for the seat in your car Harness holders keep the harness open, making it easier to get into and out of the seat. Front seat passengers can enjoy up to seven inches more legroom with the re', 120, SYSTEM_COMBINE_BLOB(5), '1'),
(7, 'Hand made glass', 'Hand painted 20 ounce wine glass with Eeyore from Winnie the Pooh on it. The bottom of the base is painted to match. Each one of my glasses is hand painted, no stickers or vinyl are used, and they are hand wash only. Because of the nature of each glass being hand painted, lines may vary from glass to glass, and color may vary from different screen resolutions. Please don''t hesitate to contact me with any questions you may have!', 58, X'', '1');
