INSERT INTO PUBLIC.PRODUCT(ID, NAME, DESCRIPTION, PRICE, IMAGE, VERSION) VALUES
(8, 'Nails', 'Complete all your woodworking projects at home or at work quickly, efficiently and produce long-lasting results with the quality nail kit. Give your projects the professional finish they deserve The nail set includes a very handy kit that allows you to separate them by size, making your job a lot easier. No time will be wasted looking for nails of the right size, making your projects swifter and more professional The nail set includes nails of many sizes to suit all your woodworking projects and', 5, SYSTEM_COMBINE_BLOB(6), '1'),
(9, 'Ethernet', 'STREAM FAST, FASTER, FASTEST Switch today for always-fast internet throughout your home. Now everyone can stream at once - all at hyper speeds.', 10, SYSTEM_COMBINE_BLOB(7), '1'),
(10, 'Glasses', 'metal frame anti-reflective lens polarized Lens width: 64 millimeters [ Polarized Light Resin Lense ]: Professional HD yellow lenses which are design for strong light compensation and 100% protection of UV 400. The multi-layered polarized lens will improve the brightness in the dark and absorb the glaring light which may hurt your eyes. Its material is wear-resisting resin made in Germany, long-time wearing wont produce fatigue.', 18, SYSTEM_COMBINE_BLOB(8), '1'),
(11, 'Apple', 'Largest Super Retina display. Fastest performance with A12 Bionic. Most secure facial authentication with Face ID.  Breakthrough dual cameras with Depth Control.', 10000, SYSTEM_COMBINE_BLOB(9), '1'),
(12, 'Dishes', '16-piece round dinnerware set; service for 4 AB-grade porcelain; BPA-free; lightweight yet durable Elegant white with contemporary red-trim detail Safe in your microwave and oven as well as dishwasher-safe Includes 4 each: 10.5-inch dinner plate, 7.5-inch dessert plate, 5.5 x 2.75-inch bowl, and 4-inch-tall mug', 23, SYSTEM_COMBINE_BLOB(10), '1'),
(13, 'App Market', 'Buy market place in our app', 1000000, SYSTEM_COMBINE_BLOB(11), '1'),
(14, 'Yard Rover', 'The Yard Rover features two, air-filled wheels, making it easier to lift, balance and maneuver. The loop handle allows users to push, pull or dump the contents of the Yard Rover. It features a rust-proof 5-cubic foot poly tray and 300-pound load capacity, perfect for residential use. EASY TO ASSEMBLE.', 25, SYSTEM_COMBINE_BLOB(12), '1'),
(15, 'Recycling Bin', 'A practical recycling station right at your desk Durable polypropylene wastebasket makes recycling convenient. The wastebasket is sized to fit next to or under desks. The "Recycle" logo is imprinted on the wastebasket.', 11, X'', '1');
